function Header() {
    return (
        <div className="header">
            <HamburgerMenu/>
            <Title title="The FPL Bible"/>
        </div>
    )
};

function Title(props) {
    return (
        <h1>{props.title}</h1>
    )
};

function HamburgerMenu() {
    return (
        <div className="hamburger">
                <span className="bar"></span>
                <span className="bar"></span>
                <span className="bar"></span>
            </div>
    )
};

export default Header;
